function App() {
  return (
    <div className="bg-black h-screen w-full">
      <nav className="w-full h-[13%] bg-gray-800 flex flex-row justify-between text-2xl text-white">
        <button>olle</button>
        <button>time</button>
        <button>dou</button>
        <button>neyney</button>
      </nav>
    </div>
  );
}

export default App;
